import React, { Component } from 'react';
import { Link } from 'react-router-dom'

const Options = (props) => {

    const { name, path } = this.props.option;
    return (
        <div>

            <li><Link to={path}>{name}</Link></li>

        </div>
    )

}

export default Options;
